import react from 'react'

class Signup extends React.Component {
	render () {
		return (
			<div>
				<div className="card">
					<div>
						<input placeholder="Email" className="form-control" />
					</div>
					<div>
						<input placeholder="Password" className="form-control" />
					</div>
				</div>
			</div>
		)
	}
}

export default Signup;
